  false,\n\t\"url\": null,\n\t\"notes\": \" County subdivisions are the primary divisions
  of counties and their equivalent entities for the reporting of Census Bureau data.
  Theyn               include legally-recognized minor civil divisions (MCDs) and
  statistical census county divisions (CCDs), and unorganized territories. For the
  2010 Census,n               the MCDs are the primary governmental and/or administrative
  divisions of counties in 29 States and Puerto Rico; Tennessee changed from having
  CCDs forn               Census 2000 to having MCDs for the 2010 Census. In MCD States
  where no MCD exists or is not defined, the Census Bureau creates statistical unorganizedn
  \              territories to complete coverage. The entire area of the United States,
  Puerto Rico, and the Island Areas are covered by county subdivisions. Then               boundaries
  of most legal MCDs are as of January 1, 2013, as reported through the Census Bureau's
  Boundary and Annexation Survey (BAS). The boundaries ofn               all CCDs,
  delineated in 21 states, are those as reported as part of the Census Bureau's Participant
  Statistical Areas Program (PSAP) for the 2010 Census.n            \",\n\t\"license_title\":
